import React from 'react';
import ReactDOM from 'react-dom';

// import App from './app';

import './index.css';

import * as serviceWorker from './serviceWorker';

function Munction() {
    <div>
        <p>some text</p>
    </div>
    ReactDOM.render(<App />, document.getElementById('root'));
}

